INSERT INTO ANTMS.TBUSS009 (DOID, NOTE, CDAT, USID, CSID, CTYP, STAT, STA2, TILT) VALUES (1506159975075, '<p></p><p><br></p><p>本周事务：</p><p>跟进上个星期的需求和异常代码修改</p><p><br></p><p>不足点：</p><p>1.没太注重细节，测试后没太全面看导致暴露的其他问题，仅仅处理针对性问题而没看到其他问题</p><p>2.一方面有些测试次数较少，导致偶尔有成功的情况，另一方面由于测试数据量较少，没能很好的和需求人员协商好</p><p>3.由于自己源码更新频率太低导致在错误的源码上操作，消耗了很多时间</p><p>4.因为即使测试成功后，不知道代码是否可以提交导致与数据库更新后又得重新把改动的代码填回相应的页面，也是</p><p>很消耗时间</p><p><br></p><p>比较好的方面：</p><p>1.这个星期依赖他人的次数明显少了很多，不知道是任务适当还是能力有些提升了</p><p>2.独立思考和处理的能力有些许提高</p><p><br></p><p>接下来的安排：</p><p>1.处理剩下的问题，把之前没提交的全部提交上去</p><p></p>', TO_DATE('2017-09-23 17:46:57', 'YYYY-MM-DD HH24:MI:SS'), '180340', '180023', '1', 5, 0, '9月-4');
INSERT INTO ANTMS.TBUSS009 (DOID, NOTE, CDAT, USID, CSID, CTYP, STAT, STA2, TILT) VALUES (1506656356375, '<div><br><div><p>&nbsp; &nbsp; &nbsp;我想从一个日程管理和任务管理普遍的误区，来谈谈这个问题。这个误区是，可以用日程管理来替代任务管理；它的另一种形式是，在任务管理软件中，为每一个任务定下具体执行时间。</p><p>以下展开论述：</p><p>说到时间管理，我们想到最多的应该就是日程表，我猜这得归功于陪伴我们从小到大的课程表了吧。日程表，具体来说就是给每一个待办任务安排好执行的起止时间，然后在一张时间表上直观的排列出来。课程表、传统的纸质台历、电脑和手机上的日历软件，都是实现这个功能的工具。这是最直觉的时间管理方式：每一个空闲的时段就是一个坑，任务就是一个个萝卜，一个萝卜一个坑。如果仅限于纸上谈兵，这个解决方案是完美无缺的。我把所有时间都合理的分配给了任务；分配的时候，我肯定还仔细考虑过任务的轻重缓急，确保过没有重要的任务被遗漏；执行的时候，只管让日程表提醒我，一项任务要开始了，然后我只需专注地做这项任务就好了，不用再来考虑一遍上述问题。一切井然有序，还有更完美的世界吗？</p><p>但是现实终究是残酷的，我们必须接受不完美的世界：领导临时安排我去接个人，只能赶紧停下手头的工作；一直打不通客户的电话，没法确认这次重要会面的时间，而一周内接下来的时间安排都要让位于这次会面，只能苦等；本想今天花半天思考一下明年的工作规划，结果白天没人打扰，却只做了一些不费脑筋的例行公事，到了下午以为可以静静思考，却每隔10分钟就有电话或者同事有琐事来找，结果什么也没写出来……理想世界中，我们以上帝视角沾沾自喜的审视着规划得完美无缺的日程表；现实世界中，一个个安排好的日程因为各种自己的或别人的原因，没有完成，只能推延，安排到明天，明天的事情不得不顺延后天，后天的事情又顺延……；推延的同时，我还得重新考虑，是不是明天的事情比这件事更重要，不能推延；最后还得通盘想一遍，全部任务都推后了，会不会遗漏了什么不该遗漏的事情……</p><p>显然，越依赖日程表管理任务，我的日程表就越充实，可调整的余地就越小。看似完美实则僵化的日程表，最终却成了严谨的时间管理实践者的噩梦。我本来是想让它像个秘书一样，做好计划后就放心的交给她，她会适时地提醒我到时间该做什么事了；至于其他还没开始的任务，暂时还不需要占据我的头脑。据说焦虑很大程度来源于对现在不可把握的未来的恐慌，有效的时间管理可能是解开这种焦虑的钥匙：专注当下，让未来可预期。显然日程表没能做到。</p><p>值得一提的是，有时候我们以为自己没在用日程表，实际上还是在用日程表的方式来做安排。比如使用其他待办任务软件，包括outlook、gmail的任务管理，iOS上的reminders，跨平台的Wunderlist等。它们都有设定任务执行时间的功能，和日程表的区别是可以设定到天，而不一定要到小时。虽然调整的灵活度更大了，但是如果还是仅仅按照执行时间属性来安排任务，终究还是容易陷入拖延、重新调整的怪圈。</p><p>那么，有没有其他方法，有效管理时间、缓解焦虑呢？也许我们将任务执行时间作为解决问题的切入点，本身就错了。那我们就回到原点再出发。这个原点就是，我们有很多要做和想做的事情，我们想充分利用有限的时间和精力，尽量多地完成优先级更高的事情。下面介绍的GTD方法，转变切入点为任务的重要性，以及当前是否具备任务执行的条件；不再强调一次性的全盘规划，转而关注计划执行过程中，是否有足够的灵活性进行调整。</p></div></div>', TO_DATE('2017-09-29 11:40:07', 'YYYY-MM-DD HH24:MI:SS'), '180023', '180023', '3', 5, 0, '你是怎样利用日程管理和任务管理软件来提高工作效率的？');
INSERT INTO ANTMS.TBUSS009 (DOID, NOTE, CDAT, USID, CSID, CTYP, STAT, STA2, TILT) VALUES (1508833163375, '<p>智能工厂建设新模式。<br></p>', TO_DATE('2017-10-24 16:19:54', 'YYYY-MM-DD HH24:MI:SS'), '180023', '180023', '4', 5, 0, '智能工厂建设新模式');
INSERT INTO ANTMS.TBUSS009 (DOID, NOTE, CDAT, USID, CSID, CTYP, STAT, STA2, TILT) VALUES (1506657314125, '<p><strong>所谓方法论呢，就是一整套解决问题的方法的有序集合</strong><span>。</span></p><p><span>很多人第一次见到</span><strong>行动管理</strong><span>这四个字的时候就会懵住，他们并不明白为什么行动还需要管理呢，</span><strong>行动不就是去做事么，要管理什么呢</strong><span>？但实际上，他们并不是没有需求，而是不知道什么样的行动需要管理、需要如何管理。</span></p><div><div><p>让我通过几个问题来举举例子：</p><ol><li><p>我大脑里面有很多想法，但是不知道怎么去执行；</p></li><li><p>我很忙的时候，却又有很多事情涌向我，弄得我很焦虑；</p></li><li><p>我有一堆事情要做，但是不知道怎么做计划；</p></li><li><p>我有一系列的计划，但是总是不知道先做哪个；</p></li><li><p>我做事情的时候，总是会被干扰，无论那是来自自己内心还是别人的；</p></li><li><p>我做完的事情，总结不出来什么好的经验……</p></li></ol><p>说到这里，您就能知道了，日常生活中，行动中总会遇到各种问题，如果想让自己能够安心地工作、生活、学习，必须找到合适的方法来解决这些困扰。那么，<strong>解决行动中存在的问题的方法，我通常叫它是行动管理</strong>。而这些方法的有序集合，就是行动管理方法论。</p><p><strong>行动管理的方法论有哪些？</strong></p><p>其实，你已经在日常工作、生活中使用了这些方法，我给你举个例子：</p><ul><li><p>事情很多的时候会把事情都记录下来；</p></li><li><p>未来某一天发生的事情我会把它们记录到日历里面；</p></li><li><p>把任务做一个列表然后进行排序一一执行；</p></li><li><p>每做完一件事情都会把这件事情划掉；</p></li><li><p>一件很大的事情会给分解成某几步分别来执行；</p></li><li><p>……</p></li></ul><br><p>上述方法您是不是也遇到过呢？无论您选择什么样的解决途径，都是对自己行动进行管理的尝试。这个世界上有很多人喜欢总结，<strong>他们会把自己的做法写下来，注明原则、方法、过程，然后不断地体系化.</strong></p></div></div>', TO_DATE('2017-09-29 11:57:35', 'YYYY-MM-DD HH24:MI:SS'), '180023', '180023', '3', 5, 0, '时间管理和任务管理有什么区别？你更倾向于做好哪个？');
