INSERT INTO ANTMS.TBUSS009 (DOID, NOTE, CDAT, USID, CSID, CTYP, STAT, STA2, TILT) VALUES (1507886626031, '<p></p><p style="">本周事务：</p><p style="">1.新增2个查询进程</p><p style="">2.新增一个导出报表的功能</p><p style="">3.帮YY处理了少部分异常</p><p style=""><br></p><p style="">不足点：</p><p style="">1.由于之前优化后没发现BUG导致这个星期出现比较严重的突发事件</p><p style="">2.水平还是有待提高</p><p style=""><br></p><p style="">比较好的方面：</p><p style="">1.这个星期对报表处理的能力较以前好了些</p><p style=""><br></p><p style=""><br></p><p style="">接下来的安排：</p><p style="">1.把一个报表的异常处理好</p><p style="">2.将两个绩效里的需求处理好</p><p></p>', TO_DATE('2017-10-13 17:32:47', 'YYYY-MM-DD HH24:MI:SS'), '180340', '180023', '1', 5, 0, '10月-2');
INSERT INTO ANTMS.TBUSS009 (DOID, NOTE, CDAT, USID, CSID, CTYP, STAT, STA2, TILT) VALUES (1508719221406, '<p>洞察，创想，非凡体验议题分享：</p><p><span>＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝</span></p><p><span></span><br></p><p><span>关于互联网＋时代企业创新与转型之路</span></p><p><span></span><br></p><p><span>1.针对行业竞争格局部解析，对思想，政格，组织路线进行总纲概况。</span></p><p><span>2.价格创造范式，解读工业文明规模经济，如何对企业资源配套思考。</span></p><p><span>3.时代精神的新模式，谈到共享经济，在行业自我导向如何满意客户的需求；客户导向，如何满意那些客户的需求；竟争导向，如何差异化满足客户的需求；需求导向，满足客户的那些需求。</span></p><p><span>4.道生一，一生二，二生三，二生万物，谈到元创新，简化与重点，行业级，供给技术的驱动，产品服务的创新；道是无，一和二是对立的统一，相反相成；</span></p><p><span></span><br></p><p><span>5.商业模式及创新总揽。创造价值到价值的传递。</span></p><p><span>6.企业的组织成本，免费的形式是时间成节约，增值。</span></p><p><span>7.创新三大切入：技术推动；持续改进、工匠精神；需求探索。</span></p><p><span>8.二无组织，主流组织：效率优先，运营导向，量化考核，厌恶风险。</span></p><p><span>9.对用户既听，不能全听。</span></p><p><span>10.变革与创新，先人后事第一，结构组合第二，实施运营第三。</span></p><p><span></span><br></p><p><span>诸葛亮之教训</span></p><p><span>能攻心则反侧自消，从古知兵非好战；</span></p><p><span>不审势即宽严比误，后来治蜀要深思。</span></p><p><span></span><br></p><p><span>如何思考对行业求反，对于行业的通用性概况，企业平台是成长的领先；</span></p><p><span>如何思考从产品到从平台再生态系统；</span></p><p><span></span><br></p><p><span>总结来讲，创新可以如何与客户为导向，首先是组织创新，其次是战略的创新，再到产品的创新，对矛盾体的观察，对于问题不能用产生问题方式去解决，以空间换时间，集小胜为大胜。</span></p><p><span>将复杂问题简单化，先解构，分而治之，再重构，所以对于简单化的要旨，顺从某种机理的结构化</span></p><p><span></span><br></p><p><span>反者道之动（揭示了事物运动变化的原因和动力），不完美至美，自由创造并享受自由；</span></p><p><span><br></span></p><p><span></span></p><p>AI时代ERP的建设:</p><p>＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝</p><p><span></span><br></p><p><span>1.ai时代及企业信息化的趋势</span></p><p><span>智能企业：生产方式，服务，管理，产品，设备的智能化</span></p><p><span>1.运用大数据全方位服务企业战略与运营（供应商资源、企业内部资料、外部环境、用户、客户）</span></p><p><span>2.跨界大数据的对接（局域，物联，互联网）流程驱动，效益导向，服务化，数据化，业务为主线，集成化。</span></p><p><span>3.企业信息化的首要任务，建立，改善财务管理与供应链管理</span></p><p><span>4.战略性的成长</span></p><p><span></span><br></p><p><span>2.企业信息化的建设路径</span></p><p><span>商业智能，辅助决策</span></p><p><span></span><br></p><p><span>3.erp价值回归，建设</span></p><p><span>1)erp为核心</span></p><p><span>2)人性化，敏捷化，柔性化</span></p><p><span>3)流程驱动</span></p><p><span>4)互联网＋（人工智能，大数据，云计算，物联网的技术手段）</span></p><p><span>思考：实际发生了什么？背后的原因是什么？执行（谁来做什么？）；有哪些对措施？</span></p><p><br><span></span></p><p><span></span></p><p><span></span></p><p><span></span></p><p><span>4深耕细作，erp深化应用</span></p><p><span>1).应用层次诊断</span></p><p><span>2).基础应用</span></p><p><span>3).深化应用</span></p><p><span>4).外延管理</span></p><p><span>5).机器人的应用</span></p><p><span>6).未来</span></p><p><span></span><br></p><p>全面预算,设备系统，人才管理平台，</p><p>＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝</p><p><span>全面预算</span></p><p><span>1.为什么会实现全面预算（文化，制度，it）</span></p><p><span>2.为何控？控什么？何时控？怎么控？</span></p><p><span></span><br></p><p><span>oracle设备系统：</span></p><p><span>1.系统介绍</span></p><p><span><br></span></p><p><span>人才梯队管理：</span></p><p><span>1.什么样的人可以称为企业的骨干人才？</span></p><p><span>2.未来人力资源管理如何制创价值</span></p><p><span>3.人才的规划</span></p><p><span>4.战略性人才规划框架</span></p><p><span>5.人才盘点可视化，准确化，常态化与体系化</span></p><p><span>6.人才供给的路径（外部获取，内部培养）人才库</span></p><p><span>7.精英人才计划方法</span></p><p><span>8.未来组织能力分析</span></p><p><span>9.人才培养三用原则：适用，会用，应用</span></p><p><span>10.人才管理平台的应用</span></p><p><span></span><br></p><p><span>集团体化运维方法：</span></p><p><span>1.it管理的现状</span></p><p><span>2.运维面临的问题</span></p><p><span>3.运维服务的架构</span></p><p><span>&nbsp; 服务台，应用运维，复杂应对，需求应对</span></p><p><span>4.外包服务的规范</span></p><p><span>5.外包服务的收益</span></p><p><span></span><br></p><p><span>感知，连接，变革</span></p><p>＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝</p><p><span>1.时间变迁，消费互联网到产业互联网</span></p><p><span>2.工业时代，互联网＋时代</span></p><p><span>3.技术驱动未来</span></p><p><span>4.智能制造</span></p><p><span>5.建立以数据驱动的智能工作</span></p>', TO_DATE('2017-10-23 08:43:06', 'YYYY-MM-DD HH24:MI:SS'), '180023', '180023', '4', 5, 0, '洞察，创想，非凡体验');
