INSERT INTO ANTMS.TBUSS009 (DOID, NOTE, CDAT, USID, CSID, CTYP, STAT, STA2, TILT) VALUES (1508719107437, '<p>1.批量下单里更新生效日期为后的物料价格。</p><p>2.处理采购订单为乱码的异常。</p><p>3.处理分配编码的异常。</p>', TO_DATE('2017-10-23 08:46:08', 'YYYY-MM-DD HH24:MI:SS'), '180304', '180023', '1', 5, 0, '10月-3');
INSERT INTO ANTMS.TBUSS009 (DOID, NOTE, CDAT, USID, CSID, CTYP, STAT, STA2, TILT) VALUES (1508807390016, '<p class="MsoNormal">作者：赖元杰</p><p class="MsoNormal">&nbsp;</p><p class="MsoNormal"><span>最初对<span lang="EN-US">tableau </span>的认识，停留在“可视化”的层面，如何将一个报表做更漂亮一些？或者更加艺术一些，上手之后，发现它是非常易用的数据分析工具，很快就可以上手，开发一些数据报表可以简单，快速的完成，后来研究如何将开发好的报表集成到自己开发<span lang="EN-US">web</span>系统中，慢慢喜欢上<span lang="EN-US">tableau</span>这个工具<span lang="EN-US">;</span>鼓起勇气参加大中华数据分析争霸赛，参加比赛的资格水平肯定是不够，重要的是可以跟一些数据分析大师学习，吸收他们的经验，学习他们的分析思路，其实<span lang="EN-US">tableau</span>把数据分析的门槛降低了，原来由<span lang="EN-US">IT</span>人员开发，变成由业务部门自助开发完成，<span lang="EN-US">IT</span>部门更多去专注数据的整理和提供数据的底座即可，业务人员根据自己的业务实现自助分析。<span lang="EN-US"><o:p></o:p></span></span></p><p class="MsoNormal"><span lang="EN-US">&nbsp;</span></p><p class="MsoNormal"><span>这次参加峰会也是带着目的去的，比如：<span lang="EN-US"><o:p></o:p></span></span></p><p class="MsoNormal"><span lang="EN-US">1.</span><span>如何解决<span lang="EN-US">tableau</span>报表集成到<span lang="EN-US">web</span>系统的方法。<span lang="EN-US"><o:p></o:p></span></span></p><p class="MsoNormal"><span lang="EN-US">2.</span><span>如何解决<span lang="EN-US">tableau</span>报表通过<span lang="EN-US">URL</span>传参数，让报表带初始化条件。<span lang="EN-US"><o:p></o:p></span></span></p><p class="MsoNormal"><span lang="EN-US">3.</span><span>如何学习自定义地图的方法，了解如何使用工具描绘定位坐标，生成坐标数据。<span lang="EN-US"><o:p></o:p></span></span></p><p class="MsoNormal"><span lang="EN-US">4.</span><span>通数据分析争霸赛比赛，了解其它选手优秀案例，如何掌握数据分析的思路，发现数据的真相。<span lang="EN-US"><o:p></o:p></span></span></p><p class="MsoNormal"><span lang="EN-US">5.</span><span>了解最新数据技术的动态以及市场热点。<span lang="EN-US"><o:p></o:p></span></span></p><p class="MsoNormal"><span lang="EN-US">&nbsp;</span></p><p class="MsoNormal"><span lang="EN-US">Tableau</span><span>团队介绍产品的新特性，数据可视化的展示给观从带来了视觉冲击，在活动现场可以与更多的数据大师面对面的交流，通过<span lang="EN-US">tableau</span>高层的分享，更加深入对<span lang="EN-US">tableau</span>的理解，对于数据未知的未知，或者已知的未知，指明了其核心的理念和发展趋势，如何去挖掘数据故事等等分析的思想，对<span lang="EN-US">tableau</span>理解是层次上的提升。<span lang="EN-US"><o:p></o:p></span></span></p><p class="MsoNormal"><span>个人认为数字化自助分析是一种趋势，针对快速的业务改变，经营重点的变化，人的差异的变化，<span lang="EN-US">IT</span>需要改变的是它节奏，如何实现数据稳定保证数据的价值，在华为公司<span lang="EN-US">tableau</span>已经不是一个工具了，而是作为中间件使用，将它集成到数字化自助平台中，他们开始在建设数据生态环境，建立数据分析的文化，敏捷的分析思想，在企业内部作为一种常态，如何从同源到开源，再到开放阶段的建设，让员工享受数字化带来的变化，这不单是工作效率提升，也是适应数字时代的发展趋势。<span lang="EN-US"><o:p></o:p></span></span></p><p class="MsoNormal"><span>认识了<span lang="EN-US">tableau</span>高级的技巧，例如：如何建立空间文件，如何自定义背景地图的方法等级；<span lang="EN-US">Rstudio</span>技术；<span lang="EN-US">MapBox</span>应用<span lang="EN-US">;</span>数据可视化架构与应用等等。<span lang="EN-US"><o:p></o:p></span></span></p><p class="MsoNormal"><span>其实是它本身还有好多生态的配套技术，如<span lang="EN-US">Apache Kylin</span>技术，极大提速<span lang="EN-US">hadoop</span>上<span lang="EN-US">sql</span>速度，带来流畅大数据交互式分析，通预计算，现场演示<span lang="EN-US">49</span>亿条数据，<span lang="EN-US">1</span>秒的响应速度；<span lang="EN-US"><o:p></o:p></span></span></p><p class="MsoNormal"><span>了解<span lang="EN-US">Informatica</span>如何利用数据管理，数据治理，数据管控等方法去发挥数据的有效价值，可能之前更多去做可视化数据的分析以及挖掘本身数据问题，忽略数据源头，没有想过如何去治理数据，管控数据，数据安全，数据质量等方面去思考，他们对企业广泛数据摄入，大数据处理有一套完整的解决方案。<span lang="EN-US"><o:p></o:p></span></span></p><p class="MsoNormal"><span>通过案例的分享以及个人思考，认为<span lang="EN-US">IT</span>更加要专注以及重视数据的治理，数据的质量，这样才能数据分析起到有效的价值。<span lang="EN-US"><o:p></o:p></span></span></p><p class="MsoNormal"><span>针对传统的企业，如何拥抱大数据时代，改变工作效率<span lang="EN-US">;</span>如何处理数据过程中的挑战，<span lang="EN-US"><o:p></o:p></span></span></p><p class="MsoNormal"><span>如何建立理想的数据服务模式<span lang="EN-US">;</span>如何研究发现数据真相等等一些问题都是值得我们去思想，去面对的。我们不缺数据，我们缺的是从有限或者瑕疵的数据中研究发现事物真相的能力。<span lang="EN-US"><o:p></o:p></span></span></p><p class="MsoNormal"><span>个人观点，公司要想让数据真正发挥价值，建立数据生态圈是企业发展的趋势，向数字化的转型，真实迈向数字时代，让自助可视分析的形式得到有效的推广，提高员工对数据分析的意识，人人都可以成分数据分析师，享受数据的艺术，数据真相带来的改变。<span lang="EN-US"><o:p></o:p></span></span></p><p class="MsoNormal"><span>建议：<span lang="EN-US"><o:p></o:p></span></span></p><p class="MsoNormal"><span lang="EN-US">1.</span><span>建立格力数字化协会，推广数字化的生态圈，更加进一步为促进企业的发展需要去准备。<span lang="EN-US"><o:p></o:p></span></span></p><p class="MsoNormal"><span lang="EN-US">2.</span><span>建立数据管控，治理数据的机制管理办法，为了降低以后数据的成本投入。<span lang="EN-US"><o:p></o:p></span></span></p><p class="MsoNormal"><span lang="EN-US">3.</span><span>定期推送分享一些数据案例以及组织数据分析的培训。<span lang="EN-US"><o:p></o:p></span></span></p><p class="MsoNormal"><span lang="EN-US">4.</span><span>搭建数字可视化自助分析平台，让数据交互成为常态，改变员工对数据价值的意识<span lang="EN-US">,</span>利用的敏捷数据分析工具以及数据应用思路更加符合企业实际，缩短数据与业务的距离<span lang="EN-US">.<o:p></o:p></span></span></p><p class="MsoNormal"><span lang="EN-US">&nbsp;</span></p><p>
