INSERT INTO ANTMS.TBUSS009 (DOID, NOTE, CDAT, USID, CSID, CTYP, STAT, STA2, TILT) VALUES (1509287931250, '<p>SCC</p><p>1.新供方模块功能的完善。</p><p>2.申购单据填写控制开发。</p><p>3.旧系统送货单移迁到新系统开发及测试。</p><p><br></p><p>HT:</p><p>1.单据的财务执合并控制开发上线测试</p><p>2.挂帐单打印功能开发</p><p>3.发票管理手工输入发票进程开发。</p><p>4.371，373公司上线</p><p>5.部门管理报表导出</p><p><br></p><p>PRO:</p><p>1.针对测试组的测试异常进行系统完善</p><p><br></p><p>ANT:</p><p>1.系统上线分享。</p><p>2.增加统计功能的开发</p><p>&nbsp;</p><p>出口技术部信息化平台</p><p>1.原型需求确认</p><p><br></p><p>=========================================================</p><p>HT:</p><p>1.采购挂帐增加关联供应商入库信息信号的查询</p><p>2.复制用户权限的功能开发</p><p>3.批量打印的功能开发、</p><p>4.发票管理发票录入上线测试</p><p>5.财务执行功能完善以及测试</p><p><br></p><p>SCC:</p><p>1.计算机设备标准库开发。</p><p><br></p><p>PRO:</p><p>1.测试导常系统完善开发</p><p><br></p><p>ANT:</p><p>1.关键用户在线寻入需求模板开发</p><p>2.统计功能完善</p><p><br></p><p>MAT:</p><p>1.增加下发功能</p><p>2.增加查询权限的控制</p><p><br></p><p>出口技术部信息化平台</p><p>1.首页，登录，基础信息模板，类型管理，下发管管理的开发</p><p><br></p><p><br></p><p><br></p>', TO_DATE('2017-10-29 22:47:47', 'YYYY-MM-DD HH24:MI:SS'), '180023', '180023', '1', 5, 0, '10月-4');
INSERT INTO ANTMS.TBUSS009 (DOID, NOTE, CDAT, USID, CSID, CTYP, STAT, STA2, TILT) VALUES (1508578200187, '<p>工作事项：</p><p>1.合同系统财务执行进程合并开发</p><p>2.合同系统发票录入开发</p><p>3.合同系统合同模板和附件无法上传异常处理</p><p>4.合同系统合同附件无法下载异常处理</p><p>完成情况描述：</p><p>合同系统财务执行进程合并待测试。发票录入开发完成。合同系统模板异常还未处理完毕。不含税合计大小写不能正常保存数据。其他异常处理完毕。</p><p>下周计划：</p><p>完成财务执行进程合并测试。开发挂账单的其他需求。开发智能装备技术研究院合同上线接口。<br></p>', TO_DATE('2017-10-21 17:41:06', 'YYYY-MM-DD HH24:MI:SS'), '180302', '180023', '1', 5, 0, '10月-3');
