INSERT INTO ANTMS.TBUSS009 (DOID, NOTE, CDAT, USID, CSID, CTYP, STAT, STA2, TILT) VALUES (1506160327937, '<p>学习总结<br>一、&nbsp;&nbsp;&nbsp; 本周学习<br>在本周学习过程中，本人着重是在工作中学习，依旧是学习layUI和NUTZ框架，重点是layui的table、element、layedit；nutz的mvc交互、工具类等要点部分的学习。在学习之后,本人受获颇多。在之后的工作中必将更加努力的学习为以后的工作作下良好的铺垫！<br>二、&nbsp;&nbsp;&nbsp; 本周工作<br>在本周工作中，本人着重于处理赖工布下的本周任务工作，完成了评分系统在用户节点、任务节点、面板节点的前端页面布局、前后端数据交互、后端增删查的功能点。在这个工作过程中，遇到过很多的问题，比如前端获取页面的数据、界面的动态性、前端向后台传递数据、后台对文本的特殊转化、流等问题。但是本人通过在上班时间和下班时间的不懈努力，圆满的完成了本周的任务。与此同时，本人在之后的工作中必将更加努力，努力完成领导布置的所有任务，并且永远怀有一颗进取和不懈的心！<br>三、&nbsp;&nbsp;&nbsp; 提案改善<br>通过本周辛苦的学习和工作，本人也发现了许多问题，并且在代码中逐渐优化和改善代码！由此，我在此提出：<br>1.&nbsp;&nbsp;&nbsp; 在之后的工作中，我们应该不断的发现代码结构问题并作出优化和改善，并且与组员之间互相交流，然后逐渐在组内之间形成一套规范，以便于之后的开发。<br>2.&nbsp;&nbsp;&nbsp; 在工作时，我们应该勇于去尝试和面对新的方式和技术，让我们永远不至于相较于社会而落伍。<br>以上为本人在本周的学习和工作总结，望各位领导提出意见，谨此！谢谢阅读！<br><br><br>创作人：王艺锦<br>日期：2017-9-9<br></p>', TO_DATE('2017-09-23 17:53:34', 'YYYY-MM-DD HH24:MI:SS'), '180365', '180023', '1', 5, 0, '9月-1');
INSERT INTO ANTMS.TBUSS009 (DOID, NOTE, CDAT, USID, CSID, CTYP, STAT, STA2, TILT) VALUES (1506158723296, '<p>工作事项：</p><p>1.国内配件汽运按出货通知单进程开发<br>2.电票管理增加修改功能开发<br>3.出差城市列表对应标准维护进程开发<br>4.合同发送厂家解锁进程开发<br></p><p>5.合同系统单点登录功能开发</p><p><br></p><p>完成情况描述：</p><p>前四个功能点现已开发完毕，合同系统单点登录功能未开发完，用户登录时，未能跳转至正确的界面。后台数据显示异常。</p><p><br></p><p>下周计划：</p><p>下周下分厂实训，了解生产状况<br></p>', TO_DATE('2017-09-23 17:29:31', 'YYYY-MM-DD HH24:MI:SS'), '180302', '180023', '1', 5, 0, '9月-1');
