INSERT INTO ANTMS.TBUSS009 (DOID, NOTE, CDAT, USID, CSID, CTYP, STAT, STA2, TILT) VALUES (1508039878171, '<p>PRO:</p><p>1.待处理超期单据自动发送邮件服务开发。</p><p>2.承包商变更申请单进程修改。</p><p><br></p><p>SCC:</p><p>1.处理待审电子审批表没有单的异常</p><p>2.修改采购订单查询导出报表的功能</p><p>3.处理分配供方代码审批表没有单的异常</p><p>4.过滤批量下单的计划到货时间</p><p>5.处理询价单里没有单的异常</p><p>6.优化供方交期管理的功能（优化输入条件，按希望到货时间降序排列，增加业务员，导出报表，导入流程数据）</p><p>7.供应商管理进程买卖方条件过滤</p><p>8.新供应方电子审批表增加组别对应管理员进程维护开发</p><p>9.旧系统送货单功能的迁移</p><p><br></p><p>HT:</p><p>1.前端脚本的升级，解决填写单据返回的异常。</p><p>2.新平台增加填写合同的权限。</p><p>3.结算员手工录入发票功能开发。</p><p>4.挂帐单可修改字段后台动控制开发。</p><p><br></p><p>ANT:</p><p>1.用户权限菜单功能开发。</p><p>2.任务管理，看板管理，效绩功能能完善。</p><p>3.邮件推送服务。</p><p>================================================</p><p>PRO:</p><p>1.解决承包商异常单据问题。</p><p>2.承包商变量流程理录入</p><p><br></p><p>SCC:</p><p>1.旧系统送货单功能测试</p><p>2.供应商管理进程买卖方条件过滤</p><p>3.新供应方电子审批表增加组别对应管理员进程维护开发</p><p><br></p><p>HT:</p><p>1.财务执行进程合并开发</p><p><br></p><p>MAT材料库:</p><p>1.贵金属，高分子材料功能下发功能的需求分析。</p><p><br></p><p>ANT:</p><p>1.绩效模块</p><p>成都出差！</p>', TO_DATE('2017-10-15 12:15:05', 'YYYY-MM-DD HH24:MI:SS'), '180023', '180023', '1', 5, 0, '10月-2');
