INSERT INTO ANTMS.TBUSS009 (DOID, NOTE, CDAT, USID, CSID, CTYP, STAT, STA2, TILT) VALUES (1507423427711, '<p>PRO:</p><p>1.上传附件异常处理。</p><p>2.应用服务改成windows服务，单点登录出异常。处理方法：单点登录不支持windows服务形式。</p><p><br></p><p>SCC:</p><p>1.供应商管理开发，进程实现可以监控各个公司新开方的厂家。发现问题，之前供应商导入时有好多数据不完整。</p><p>2.公司管理开发</p><p>3.批理下单，按公司控制下单异常处理</p><p>4.供方交期管理开发</p><p>5.订单查询进程修改</p><p>6.处理待审电子审批表，已审电子审批表，分配供方代码审批表，全部单据的模糊搜索和分页</p><p>7.物料明细增加一个物料质保字段维护，并发收通知邮件增加</p><p>8.供方申请表电子审批，增加组的选项，以及后台维护开发.</p><p>9.送货单打印修改</p><p><br></p><p>HT:</p><p>1.财务单据控制开发</p><p>2.前端脚本升级开发</p><p>3.财务执行进程合并开发</p><p><br></p><p><br></p><p>绩效系统：</p><p>1.看板管理，任务管理，绩效管理等功能完善。</p><p>2.增加基础表维护进程开发，团队，用户，科室等。</p><p><br></p><p>======================================================================================================</p><p><br></p><p>PRO：</p><p><br></p><p>1.武汉公司上线，基础数据录入。</p><p><br></p><p>SCC:</p><p>1.供应商管理进程，增加买卖方条件过滤。</p><p>2.老系统数据迁移以及进程迁移。</p><p><br></p><p>HT:</p><p>1.财务单据控制开发</p><p><br></p><p>1.出口技术部信息化系统开发，原型确认，底层代码</p>', TO_DATE('2017-10-08 08:44:17', 'YYYY-MM-DD HH24:MI:SS'), '180023', '180023', '1', 5, 0, '9月-4');
