INSERT INTO ANTMS.TBUSS009 (DOID, NOTE, CDAT, USID, CSID, CTYP, STAT, STA2, TILT) VALUES (1507565169796, '<p class="MsoTitle"><span>周报<span lang="EN-US"><o:p></o:p></span></span></p><p class="MsoListParagraph"><!--[if !supportLists]--><span lang="EN-US">1.<span>&nbsp; </span></span><!--[endif]--><span>学习<span lang="EN-US"><o:p></o:p></span></span></p><p class="MsoListParagraph"><!--[if !supportLists]--><span lang="EN-US">1)<span>&nbsp;&nbsp;</span></span><!--[endif]--><span>完成<span lang="EN-US">layui</span>和<span lang="EN-US">nutz</span>日常的学习。<span lang="EN-US"><o:p></o:p></span></span></p><p class="MsoListParagraph"><!--[if !supportLists]--><span lang="EN-US">2.<span>&nbsp; </span></span><!--[endif]--><span>工作<span lang="EN-US"><o:p></o:p></span></span></p><p class="MsoListParagraph"><!--[if !supportLists]--><span lang="EN-US">1)<span>&nbsp;&nbsp;</span></span><!--[endif]--><span>完成上周遗留的部门<span lang="EN-US">bug</span>。<span lang="EN-US"><o:p></o:p></span></span></p><p class="MsoListParagraph"><!--[if !supportLists]--><span lang="EN-US">2)<span>&nbsp;&nbsp;</span></span><!--[endif]--><span>完成用户节点的增删改查。<span lang="EN-US"><o:p></o:p></span></span></p><p class="MsoListParagraph"><!--[if !supportLists]--><span lang="EN-US">3)<span>&nbsp;&nbsp;</span></span><!--[endif]--><span>增加用户个人任务节点的增加。<span lang="EN-US"><o:p></o:p></span></span></p><p class="MsoListParagraph"><!--[if !supportLists]--><span lang="EN-US">4)<span>&nbsp;&nbsp;</span></span><!--[endif]--><span>完成看板节点的功能和界面重构。<span lang="EN-US"><o:p></o:p></span></span></p><p class="MsoListParagraph"><!--[if !supportLists]--><span lang="EN-US">5)<span>&nbsp;&nbsp;</span></span><!--[endif]--><span>解决项目<span lang="EN-US">url</span>编码解析乱码的问题。<span lang="EN-US"><o:p></o:p></span></span></p><p class="MsoListParagraph"><!--[if !supportLists]--><span lang="EN-US">6)<span>&nbsp;&nbsp;</span></span><!--[endif]--><span>完成公司、部门、科室的增删改查。<span lang="EN-US"><o:p></o:p></span></span></p><p class="MsoListParagraph"><!--[if !supportLists