INSERT INTO ANTMS.TBUSS009 (DOID, NOTE, CDAT, USID, CSID, CTYP, STAT, STA2, TILT) VALUES (1508467475312, '<p>1.通过端口号发现占据该端口的进程号</p><p>netstat -ano | findstr "" <br></p><p>2.通过该进程号查询进程号的应用程序</p><p>tasklist | findstr ""</p><p>3.通过进程号关闭该进程</p><p>taskkil /pid ""<br></p>', TO_DATE('2017-10-20 10:48:37', 'YYYY-MM-DD HH24:MI:SS'), '180365', '180365', '4', 5, 0, '关闭进程');
INSERT INTO ANTMS.TBUSS009 (DOID, NOTE, CDAT, USID, CSID, CTYP, STAT, STA2, TILT) VALUES (1508718794000, '<p>PRO:</p><p>1.解决承包商异常单据问题。</p><p>2.承包商变量流程理录入</p><p><br></p><p>SCC:</p><p>1.旧系统送货单功能测试</p><p>2.供应商管理进程买卖方条件过滤</p><p>3.新供应方电子审批表增加组别对应管理员进程维护开发</p><p><br></p><p>HT:</p><p>1.财务执行进程合并开发</p><p>1.合同系统财务执行进程合并开发</p><p>2.合同系统发票录入开发</p><p>3.合同系统合同模板和附件无法上传异常处理</p><p>4.合同系统合同附件无法下载异常处理</p><p>完成情况描述：</p><p>合同系统财务执行进程合并待测试。发票录入开发完成。合同系统模板异常还未处理完毕。不含税合计大小写不能正常保存数据。其他异常处理完毕。</p><p><br></p><p>MAT材料库:</p><p>1.贵金属，高分子材料功能下发功能的需求分析。</p><p><br></p><p>绩效管理系统：</p><p>1.任务进度，任务看板增加进度百分比显示.计划完成时间-当前时间x100</p><p>2.附件查看/下载功能完善</p><p>3.看板管理，条件显示问题</p><p>4.邮件发送提示修改</p><p>5.文档管理，类型过滤</p><p>6.绩效表汇总，增加“发邮件”列，可触发邮件给领导以及抄送当前用户。</p><p>7.看板管理，执行时，邮件显示计划完成时间</p><p>8.用户管理，编辑时增加团队修改</p><p>9.绩效根据用户权限筛选</p><p>10.任务管理导出将描述的格式去掉，按键名字改成“导出DS”</p><p>11.所有详细查看增加打印功能。</p><p>12.用户管理，增加一个“科室”列</p><p>13.绩效统计结算多次异常</p><p>14.文档详细查看增加分享功能，输入分享用户邮件号</p><p>15.关键用户看板，增加：测试中，验收中的选项，验收通过分为：5个级别,基准分数分别乘以：1.0;0.9;0.8;0.7,0.6;同时加到用看板管理，个人看板。</p><p>16.团队管理增加人员增加/删除（cbase010）</p><p>========================================================================================================</p><p><br></p><p>SCC:旧系统功能迁移</p><p>HT：财务执行模板测度</p><p>ANT:上线分享测试</p><p>出口技术部信息平台：功能开发</p><p>PRO:石家庄子公司上线</p><p><br></p><p><br></p><p><br></p><p><br></p><p><br></p>', TO_DATE('2017-10-23 08:34:11', 'YYYY-MM-DD HH24:MI:SS'), '180023', '180023', '1', 5, 0, '10月-3');
INSERT INTO ANTMS.TBUSS009 (DOID, NOTE, CDAT, USID, CSID, CTYP, STAT, STA2, TILT) VALUES (1506173364859, '<p style="text-align: left;">1.	学习</p><p>1)<span>	</span>完成layui和nutz日常的学习。</p><p>2)<span>	</span>阅读了layui的更新日志。</p><p>3)<span>	</span>阅读些许JVM的书籍。</p><p>2.<span>	</span>工作</p><p>1)<span>	</span>完成上周遗留的任务节点和看板节点的部分功能。</p><p>2)<span>	</span>完成了自动评分节点和手动评分节点的基本页面和业务逻辑。</p><p>3)<span>	</span>完成了评分成绩的汇总显示和评分细节的显示。</p><p>4)<span>	</span>完成了所有界面的页面刷新的问题解决。</p><p>3.<span>	</span>下周安排</p><p>1)<span>	</span>在学习方面，我将继续完成layui和nutz的学习，其余的时间阅读部分其它关于java的知识的书籍。</p><p>2)<span>	</span>完成上周遗留的评分节点显示界面和逻辑方面的优化。</p><p>3)<span>	</span>完成所有页面遗留的个别问题。</p><p>4)<span>	</span>根据领导的指示，完成下发的开发任务。</p><p>此致！谢谢阅读！</p><p>编者：王艺锦</p><p>日期：2017-9-15</p>', TO_DATE('2017-09-23 21:30:39', 'YYYY-MM-DD HH24:MI:SS'), '180365', '180023', '1', 5, 0, '9月-2');
